post_content = "<h3>Foundation for Rural Regional Renewal</h3>
<h3>Description</h3>
The aim of this foundation is to provide assistance to the not-for-profit communities/organisations affected by drought.
<h3>Eligibility</h3>
Not-for-profit organisations.
Should have an ABN or Incorporation number.
Should not be an individual.
<h3>How to apply</h3>
Call 354302399 or visit the web page <a style=\"text-decoration-line: underline; transition-duration: 0.3s; transition-timing-function: ease; color: #337ab7; outline: none; font-family: 'Open Sans', GlacialIndifference, sans-serif; font-size: 15px;\" href=\"https://frrr.org.au/funding/find-funding-now/available/?who=I+am+looking+for+funds+for+my+organisation&amp;organisation=Not-for-profit+organisation&amp;location=VIC&amp;context=Drought/\">HERE</a>.
<figure>
											<a href=\"https://frontierservices.org/\" target=\"_blank\" rel=\"noopener\">
<img width=\"300\" height=\"300\" src=\"/wp-content/uploads/2021/08/5.png\" alt=\"\" loading=\"lazy\">								</a><figcaption></figcaption></figure>
<h4>Contact</h4>
<ul>
 	<li>
											<a href=\"tel:354302399\">
354302399
</a></li>
 	<li>
											<a href=\"https://frontierservices.org/\">
frontierservices.org/
</a></li>
 	<li>
										fsfundraising@frontierservices.org</li>
</ul>"
